import React, { useState } from 'react';

const AddList = () => {
    const [name, setname] = useState("");
    const [list, setList] = useState([]);
    const [age, setAge] = useState("");
    const [ageList, setAgeList] = useState([]);

    const onnameChange = (e) => setname(e.target.value);
    const onageChange =(e) => setAge(e.target.value);

    const onBtnClick = (e) => {
        const newList = [...list];
        newList.push(name);

        setList(newList);
        setname("");
        
        const ageInput = [...ageList];
        ageInput.push(age);

        setAgeList(ageInput);
        setAge("");  
    };
    return (
        <div>
            <h2>List Add</h2>
            
            <div>
                <input value={name} onChange={onnameChange}/>
                <input value={age} onChange={onageChange}/>
                <input type="submit" onClick={onBtnClick}/>
            </div>
                
            <div>
                <ul>
                    {
                        list.map((item, index) => <li key={index}>{item}</li>)  ,  ageList.map((item, index) => <li key={index}>{item}</li>)
                    }
                   
                </ul>
            </div>




        </div>
    );
};

export default AddList;
































































